import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>This is my binary clock</h1>

      <div className="timeColumn">
        <div className="circle"></div>
        <div className="circle"></div>

        <canvas id="myCanvas" width="400" height="400" style="border:1px solid #000;"></canvas>
      </div>
    </div>
  );
}

export default App;
